import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Cookies from 'js-cookie';

function App() {
  // --- Login State ---
  const [loginForm, setLoginForm] = useState({ email: '', password: '' });
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [loginMessage, setLoginMessage] = useState('');

  // --- Contact Form State ---
  const [contactForm, setContactForm] = useState({ name: '', email: '' });
  const [contactMessage, setContactMessage] = useState('');

  // --- Step 1: Get CSRF cookie when component mounts ---
  useEffect(() => {
    axios.get('http://localhost:8000/sanctum/csrf-cookie', { withCredentials: true })
      .then(() => {
        console.log('CSRF cookie set');
      })
      .catch((error) => {
        console.error('Failed to set CSRF cookie:', error);
      });
  }, []);

  // --- Login form input change ---
  const handleLoginChange = (e) => {
    setLoginForm({ ...loginForm, [e.target.name]: e.target.value });
  };

  // --- Contact form input change ---
  const handleContactChange = (e) => {
    setContactForm({ ...contactForm, [e.target.name]: e.target.value });
  };

  // --- Login form submit ---
  const handleLoginSubmit = (e) => {
    e.preventDefault();
    setLoginMessage('');

    // Login API call
    axios.post('http://localhost:8000/login', loginForm, {
      withCredentials: true,
      headers: { 'Accept': 'application/json' }
    })
      .then(() => {
        setIsAuthenticated(true);
        setLoginMessage('Logged in successfully!');
      })
      .catch(err => {
        setLoginMessage('Login failed. Check credentials.');
        console.error('Login error:', err);
      });
  };

  // --- Contact form submit ---
  const handleContactSubmit = (e) => {
    e.preventDefault();
    setContactMessage('');

    const csrfToken = Cookies.get('XSRF-TOKEN'); // read CSRF token from cookie

    axios.post('http://localhost:8000/api/contacts', contactForm, {
      withCredentials: true,
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
        'X-XSRF-TOKEN': csrfToken,
      }
    })
      .then(res => {
        setContactMessage(res.data.message || 'Form submitted successfully!');
        setContactForm({ name: '', email: '' });
      })
      .catch(err => {
        console.error('Contact form error:', err);
        if (err.response && err.response.data.errors) {
          setContactMessage(Object.values(err.response.data.errors).join(' '));
        } else if (err.response && err.response.data.message) {
          setContactMessage(err.response.data.message);
        } else {
          setContactMessage('Error submitting form');
        }
      });
  };

  // --- Render ---
  return (
    <div style={{ padding: '2rem' }}>
      {!isAuthenticated ? (
        <>
          <h2>Login</h2>
          <form onSubmit={handleLoginSubmit}>
            <div>
              <label>Email:</label><br />
              <input
                type="email"
                name="email"
                value={loginForm.email}
                onChange={handleLoginChange}
                required
              />
            </div>
            <div>
              <label>Password:</label><br />
              <input
                type="password"
                name="password"
                value={loginForm.password}
                onChange={handleLoginChange}
                required
              />
            </div>
            <button type="submit" style={{ marginTop: '1rem' }}>Login</button>
          </form>
          {loginMessage && <p>{loginMessage}</p>}
        </>
      ) : (
        <>
          <h2>Contact Form</h2>
          <form onSubmit={handleContactSubmit}>
            <div>
              <label>Name:</label><br />
              <input
                type="text"
                name="name"
                value={contactForm.name}
                onChange={handleContactChange}
                required
              />
            </div>
            <div>
              <label>Email:</label><br />
              <input
                type="email"
                name="email"
                value={contactForm.email}
                onChange={handleContactChange}
                required
              />
            </div>
            <button type="submit" style={{ marginTop: '1rem' }}>Submit</button>
          </form>
          {contactMessage && <p>{contactMessage}</p>}
        </>
      )}
    </div>
  );
}

export default App;
